import React from 'react';
import './DeviceMeter.css';
import Rechart from '../UserHome/Rechart';
const data = [
    {
      name: 'Page A',
      uv: 4000,
      pv: 2400,
      amt: 2400,
    },
    {
      name: 'Page B',
      uv: 3000,
      pv: 1398,
      amt: 2210,
    },
    {
      name: 'Page C',
      uv: 2000,
      pv: 9800,
      amt: 2290,
    },
    {
      name: 'Page D',
      uv: 2780,
      pv: 3908,
      amt: 2000,
    },
    {
      name: 'Page E',
      uv: 1890,
      pv: 4800,
      amt: 2181,
    },
    {
      name: 'Page F',
      uv: 2390,
      pv: 3800,
      amt: 2500,
    },
    {
      name: 'Page G',
      uv: 3490,
      pv: 4300,
      amt: 2100,
    },
  ];
const DeveiceMeter = () => {
    
    return (
        <div className="container">
            <h1>Meter</h1>
                <div>
                    <div className="row ">
                        <div className="col-md-4 meter-col"><p>Date</p></div>
                        <div className="col-md-2 meter-col"><p>Vcc 1</p></div>
                        <div className="col-md-2 meter-col"><p>Vcc 2</p></div>
                        <div className="col-md-2 meter-col"><p>Vcc 3</p></div>
                        <div className="col-md-2 meter-col"><p>Current 1</p></div>
                    </div>
                    <div className="row">
                        <div className="col-md-4 meter-col"><p>12/12/21 08:06:15</p></div>
                        <div className="col-md-2 meter-col"><p>24.6V</p></div>
                        <div className="col-md-2 meter-col"><p>18.1V</p></div>
                        <div className="col-md-2 meter-col"><p>24.4V</p></div>
                        <div className="col-md-2 meter-col"><p>10A</p></div>
                    </div>
                </div>
                <ResponsiveContainer width="100%" height="100%">
        <LineChart
          width={500}
          height={300}
          data={data}
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis yAxisId="left" />
          <YAxis yAxisId="right" orientation="right" />
          <Tooltip />
          <Legend />
          <Line yAxisId="left" type="monotone" dataKey="pv" stroke="#8884d8" activeDot={{ r: 8 }} />
          <Line yAxisId="right" type="monotone" dataKey="uv" stroke="#82ca9d" />
        </LineChart>
      </ResponsiveContainer>
                <div>
                    <p className="row title-control">Control</p>
                    <div className="row">
                        <div className="col-md-2"><p>Period :</p></div>
                        <div className="col-md-4"><input type="number" /></div>
                    </div>
                    <div className="row">
                        <div className="col-md-2"><p>Freq :</p></div>
                        <div className="col-md-4"><input type="number" /></div>
                    </div>
                </div>
        </div>
    );
};

export default DeveiceMeter;
